/*
 * Mario
 */


(function(np) {

    np.Mario = {
        blocks: [],

        defaults: {
            tagName: "canvas",
            x: 50,
            y: -50,
            width: 12*5,
            height: 16*5,
            scale: 2,
            floorHeight: 50,
            direction: "right",
        },
        assets: {
            hatebu: "data:image/png;base64,",
            twitter: "data:image/png;base64,",
            rss: "data:image/png;base64,",
            pocket: "data:image/png;base64,",
        },

        createClass: function(prop) {
            prop.init = prop.init || function() {};
            prop.superClass = prop.superClass || null;

            var _class = function() {
                _class.prototype.init.apply(this, arguments);
            };

            if (prop.superClass) {
                _class.prototype = Object.create(prop.superClass.prototype);
            }

            for (var key in prop) {
                _class.prototype[key] = prop[key];
            }

            return _class;
        },
    };

    np.Mario.Element = np.Mario.createClass({
        init: function(param) {
            this.element = document.createElement(param.tagName);
            document.body.appendChild(this.element);

            var scale = param.scale || 1;

            this.element.width = param.width * scale;
            this.element.height= param.height * scale;
            this.element.style.position = "fixed";
            this.element.style.margin = "0";
            this.element.style.padding = "0";
            this.element.style.zIndex = "0";
            this.element.style.cursor = "pointer";
            // this.element.style.border = "1px solid black";

            this.setX(param.x);
            this.setY(param.y);
        },
        getX: function() {
            return  Number( this.element.style.left.replace("px", '') );
        },
        setX: function(v) {
            this.element.style.left = v + 'px';
        },
        getY: function() {
            return  Number( this.element.style.top.replace("px", '') );
        },
        setY: function(v) {
            this.element.style.top = v + 'px';
        },
        getRight: function() {
            return this.getX() + this.getWidth();
        },
        getBottom: function() {
            return this.getY() + this.getHeight();
        },
        getWidth: function() {
            return Number(this.element.width);
        },
        getHeight: function() {
            return Number(this.element.height);
        },
    });

    
})(this);
